import { h, render, Component } from 'preact';
import { useState } from "preact/hooks";
import { Choice } from './choice'; 


export const Shapes = () => {
    
    const [active, setActive] = useState({
        0: false,
        1: false,
        2: false,
        3: false,
        4: false,
    });

    const toggle = (index) => {
        // Set others to false  
        let tempObj = Object.keys(active).map((key) => {
            return active[key] = false;
        });
        tempObj[index] = true;
        
        setActive(tempObj);
    }

    return <div className="BV-shapes">
            <Choice size="Plunge" toggleFunc={(key) => toggle(key)} isChecked={active[0] === true ? true : false} indexNum={0} image={'data:image/png;base64,'} />
            <Choice size="Balconette / Balcony" toggleFunc={(key) => toggle(key)} isChecked={active[1] === true ? true : false} indexNum={1} image={'data:image/png;base64,'} />
            <Choice size="Full Cup" toggleFunc={(key) => toggle(key)} isChecked={active[2] === true ? true : false} indexNum={2} image={'data:image/png;base64,'} />
            <Choice size="Half Cup / Demi" toggleFunc={(key) => toggle(key)} isChecked={active[3] === true ? true : false} indexNum={3} image={'data:image/png;base64,'} />
            <Choice size="I don’t know" toggleFunc={(key) => toggle(key)} isChecked={active[4] === true ? true : false} indexNum={4} image={'data:image/png;base64,'} isDefault={true} />
        </div>;
};